// deno-lint-ignore-file
import {
  applyParamsToScript,
  Data,
  Validator,
} from "https://deno.land/x/lucid@0.10.6/mod.ts"

export interface DistributedSetMintDistributedSet {
  new (
    controlScript: { VerificationKeyCredential: [string] } | {
      ScriptCredential: [string]
    },
    genesisUtxo: { transactionId: { hash: string }; outputIndex: bigint },
  ): Validator
  redeemer: "Unit" | {
    BinarySplit: [{ transactionId: { hash: string }; outputIndex: bigint }]
  }
}

export const DistributedSetMintDistributedSet = Object.assign(
  function (
    controlScript: { VerificationKeyCredential: [string] } | {
      ScriptCredential: [string]
    },
    genesisUtxo: { transactionId: { hash: string }; outputIndex: bigint },
  ) {
    return {
      type: "PlutusV2",
      script: applyParamsToScript(
        "",
        [controlScript, genesisUtxo],
        {
          "dataType": "list",
          "items": [{
            "title": "Credential",
            "description":
              "A general structure for representing an on-chain `Credential`.\n\n Credentials are always one of two kinds: a direct public/private key\n pair, or a script (native or Plutus).",
            "anyOf": [{
              "title": "VerificationKeyCredential",
              "dataType": "constructor",
              "index": 0,
              "fields": [{ "dataType": "bytes" }],
            }, {
              "title": "ScriptCredential",
              "dataType": "constructor",
              "index": 1,
              "fields": [{ "dataType": "bytes" }],
            }],
          }, {
            "title": "OutputReference",
            "description":
              "An `OutputReference` is a unique reference to an output on-chain. The `output_index`\n corresponds to the position in the output list of the transaction (identified by its id)\n that produced that output",
            "anyOf": [{
              "title": "OutputReference",
              "dataType": "constructor",
              "index": 0,
              "fields": [{
                "title": "transactionId",
                "description":
                  "A unique transaction identifier, as the hash of a transaction body. Note that the transaction id\n isn't a direct hash of the `Transaction` as visible on-chain. Rather, they correspond to hash\n digests of transaction body as they are serialized on the network.",
                "anyOf": [{
                  "title": "TransactionId",
                  "dataType": "constructor",
                  "index": 0,
                  "fields": [{ "dataType": "bytes", "title": "hash" }],
                }],
              }, { "dataType": "integer", "title": "outputIndex" }],
            }],
          }],
        } as any,
      ),
    }
  },
  {
    redeemer: {
      "title": "ListRedeemer",
      "anyOf": [{
        "title": "Unit",
        "dataType": "constructor",
        "index": 0,
        "fields": [],
      }, {
        "title": "BinarySplit",
        "dataType": "constructor",
        "index": 1,
        "fields": [{
          "description":
            "An `OutputReference` is a unique reference to an output on-chain. The `output_index`\n corresponds to the position in the output list of the transaction (identified by its id)\n that produced that output",
          "anyOf": [{
            "title": "OutputReference",
            "dataType": "constructor",
            "index": 0,
            "fields": [{
              "title": "transactionId",
              "description":
                "A unique transaction identifier, as the hash of a transaction body. Note that the transaction id\n isn't a direct hash of the `Transaction` as visible on-chain. Rather, they correspond to hash\n digests of transaction body as they are serialized on the network.",
              "anyOf": [{
                "title": "TransactionId",
                "dataType": "constructor",
                "index": 0,
                "fields": [{ "dataType": "bytes", "title": "hash" }],
              }],
            }, { "dataType": "integer", "title": "outputIndex" }],
          }],
        }],
      }],
    },
  },
) as unknown as DistributedSetMintDistributedSet

